pragma solidity ^0.5.0;

contract SupplyChain {
    uint32 private productId = 0;  
    uint32 private participantId = 0;
    uint32 private ownerId = 0;

    enum ParticipantType { Manufacturer, Supplier, Consumer, Distributor, Retailer }

    struct Product {
        string modelNumber;
        string partNumber;
        string serialNumber;
        uint32 cost;
        uint32 mfgTimeStamp;
        address productOwner;
    }

    struct Participant {
        string userName;
        ParticipantType participantType;
        address participantAddress;
    }

    struct Ownership {
        uint32 productId;
        address productOwner;
        uint32 trxTimeStamp;
        uint32 price;
    }

    mapping(uint32 => Product) public products;
    mapping(uint32 => Participant) public participants;
    mapping(uint32 => Ownership) public ownerships;
    mapping(uint32 => uint32[]) public productTrack;

    event TransferOwnership(uint32 indexed productId, address indexed from, address indexed to);
    event ParticipantAdded(uint32 indexed participantId);
    event ProductAdded(uint32 indexed productId);

    function addParticipant(string memory _name, address _pAdd, ParticipantType _pType) public returns (uint32) {
        uint32 userId = participantId++;
        participants[userId] = Participant(_name, _pType, _pAdd);
        emit ParticipantAdded(userId);
        return userId;
    }

    function addProduct(uint32 _ownerId, string memory _modelNumber, string memory _partNumber, string memory _serialNumber, uint32 _productCost) public returns (uint32) {
        require(participants[_ownerId].participantType == ParticipantType.Manufacturer, "Only manufacturers can add products");
        uint32 newProductId = productId++;
        products[newProductId] = Product(_modelNumber, _partNumber, _serialNumber, _productCost, uint32(block.timestamp), participants[_ownerId].participantAddress);
        emit ProductAdded(newProductId);
        return newProductId;
    }

    modifier onlyProductOwner(uint32 _productId) {
        require(msg.sender == products[_productId].productOwner, "Not the product owner");
        _;
    }

    function transferOwnership(uint32 _user1Id, uint32 _user2Id, uint32 _prodId, uint32 _newPrice) onlyProductOwner(_prodId) public {
        require(_newPrice > 0, "Price must be greater than zero");

        ParticipantType senderType = participants[_user1Id].participantType;
        ParticipantType receiverType = participants[_user2Id].participantType;

        if (senderType == ParticipantType.Manufacturer) {
            require(receiverType == ParticipantType.Supplier, "Manufacturers can only transfer to Suppliers");
        } else if (senderType == ParticipantType.Supplier) {
            require(receiverType == ParticipantType.Distributor || receiverType == ParticipantType.Retailer, "Suppliers can only transfer to Distributors or Retailers");
        } else if (senderType == ParticipantType.Distributor || senderType == ParticipantType.Retailer) {
            require(receiverType == ParticipantType.Consumer, "Distributors and Retailers can only transfer to Consumers");
        } else {
            revert("Transfers from Consumers not allowed");
        }

        uint32 newOwnerId = ownerId++;
        Ownership storage newOwnership = ownerships[newOwnerId];
        newOwnership.productId = _prodId;
        newOwnership.productOwner = participants[_user2Id].participantAddress;
        newOwnership.trxTimeStamp = uint32(block.timestamp);
        newOwnership.price = _newPrice;

        products[_prodId].productOwner = newOwnership.productOwner;
        products[_prodId].cost = _newPrice;
        productTrack[_prodId].push(newOwnerId);

        emit TransferOwnership(_prodId, participants[_user1Id].participantAddress, newOwnership.productOwner);
    }

    function getProduct(uint32 _productId) public view returns (string memory, string memory, string memory, uint32, address, uint32) {
        Product memory product = products[_productId];
        return (product.modelNumber, product.partNumber, product.serialNumber, product.cost, product.productOwner, product.mfgTimeStamp);
    }

    function getParticipant(uint32 _participantId) public view returns (string memory, ParticipantType, address) {
        Participant memory participant = participants[_participantId];
        return (participant.userName, participant.participantType, participant.participantAddress);
    }

    function getProvenance(uint32 _prodId) external view returns (uint32[] memory, uint32[] memory, uint32[] memory) {
        uint32[] memory ownershipIds = productTrack[_prodId];
        uint32[] memory prices = new uint32[](ownershipIds.length);
        uint32[] memory ownerIds = new uint32[](ownershipIds.length);

        for (uint i = 0; i < ownershipIds.length; i++) {
            Ownership memory ownership = ownerships[ownershipIds[i]];
            prices[i] = ownership.price;
            ownerIds[i] = findOwnerId(ownership.productOwner);
        }

        return (ownershipIds, prices, ownerIds);
    }

    function findOwnerId(address _ownerAddress) internal view returns (uint32) {
        for (uint32 i = 0; i < participantId; i++) {
            if (participants[i].participantAddress == _ownerAddress) {
                return i;
            }
        }
        return 0; // Return a default value if not found
    }

    function getOwnership(uint32 _ownershipId) public view returns (uint32, address, uint32, uint32) {
        Ownership memory ownership = ownerships[_ownershipId];
        return (ownership.productId, ownership.productOwner, ownership.trxTimeStamp, ownership.price);
    }
}
